export default class Content extends Component {
    constructor() {
        super()
    }
    render() {
        return <article>
            <div className="login">
                <button>Sign up</button>
                <button>Log in</button>
            </div>
            <div className="focus">
                <div className="card card1">
                    <img src="" alt="" />
                </div>
            </div>
        </article>

    }
}
